('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '71', 'A triangle has an area of \\(x\\). If the base of the triangle is multiplied by 2, what is the area of the resulting triangle in terms of \\(x\\)?', '4734', '4x', '2x', 'x', '.5x', '0', '2x', '85', '<p>The area of a triangle is $$bh\\frac{1}{2}$$ If the new b, call it \\(b^\\prime\\) is equal to 2b then, new area is$$b^\\prime  h \\frac{1}{2}=2bh\\frac{1}{2}=2x$$ In the last step we substitute 2b for \\(b^\\prime\\) and x for \\(bh\\frac{1}{2}\\) since that is given when the question says that the new base is the old base multiplied by 2 and \\(x\\) is the area of the triangle.</p> ', '', '', '', '', '', 'Kevin', ''),
('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '72', 'A line segment has length \\(x\\). If the segment is increased by a factor of 2, what is the length of the new line segment in terms of \\(x\\)', '12651', '4x', '2x', 'x', '.5x', '0', '2x', '86', '<p>This is pretty straight forward. The segment equals \\(x\\) The segment is multiplied by two. In terms of \\(x\\) it is now \\(2x\\)</p>      ', '', '', '', '', '', 'Kevin', ''),
('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '73', 'If a weight is added to a coin so that  the chances of landing on heads is decreased by 50%, what are the chances of flipping the coin twice and landing on heads both times?', '', '1', '1/2', '1/4', '1/8', '1/16', '1/16', '87', '<p>To decrease something by 50% is to multiply it by 0.5. If a regular coin has a fifty percent chance of landing on heads and now we decrease that by 50% then the new chance of landing on heads is \\(0.5(0.5)=0.25\\). Next part of the question is an \"and\" probability. The probability of two independent events is the probability of one times the probability of the other. $$0.25\\cdot 0.25=\\left(\\frac{1}{4}\\right^2=\\frac{1}{16}$$ </p> ', '', '', '', '', '', 'Kevin', ''),
('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '74', 'Rectangle ABCD has area \\(x\\). If a new rectangle is made with a width equal to half the width of rectangle ABCD and a length equal to half the length of rectangle ABCD, what is the area of the new rectangle in terms of x?', '', 'x', '.5x', '.25x', '.005x', '.001x', '.25x', '88', '<p>Let the old rectangle\'s length and width be \\(w\\) and \\(l\\). We have given: $$wl=x$$ Now, new \\(w\\) or \\(w^\\prime = 0.5w\\) and new \\(l\\) or \\(l^\\prime=0.5l\\). The area of the new rectangle is \\(w^\\prime l^\\prime =newArea\\) Substitute the old values in for the new values using the above equations and we have \\(0.5w0.5l=newArea\\) This simplifies to \\(0.25wl=newArea\\) We are given that \\(wl=x\\) so substitute \\(x\\) into the previous equation and we have \\(newArea=0.25x\\)</p>  ', '', '', '', '', '', 'Kevin', ''),
('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '75', 'A square cake with a side equal to 1ft is cut into equal square pieces. Each square piece has 3 inch sides. If one piece is given to each child at a party and there are no leftovers, how many kids were at the party?', '', '9', '12', '16', '24', '28', '16', '89', '<p>1 square ft is 12in by 12 in. Therefore: \\(1ft^2=144in^2\\). If each piece  is 3in by 3in then each piece is \\(9in^2\\). The total square inches of cake divided by the area of each piece is $$\\frac{144}{9}=16$$. Note: \\(1ft=12in\\: 1ft^2=144in^2 \\: 1ft^3=1728in^3\\) See a pattern? This is because each time we increase a dimension we have to multiply by the conversion rate again. I.e. the volume of a cube with sides equal to 1ft is \\(1\\cdot1\\cdot1=1\\) but in inches that is \\(12\\cdot12\\cdot12=1728\\) So a cube with volume equal to \\(1ft^3\\) has volume equal to \\(1728in^3\\)</p>', '', '', '', '', '', 'Kevin', ''),
('Algebra', 'Formulas and functions', 'Functions', 'Compound functions', '', '', '', 'No Pic', '', '76', 'A square has area equal to \\(x\\). The diagonal of the square is increased by 10%.What is the new area of the square in terms of \\(x\\)?', '', '.221x', '.721x', 'x', '1.21x', '1.71x', '1.21x', '90', '<p>The diagonal of a square is the hypotenuse of a 45-45-90 degree right triangle formed by two sides of the square and the diagonal. Therefore, the diagonal of a square is equal to a side times the square root of two. $$D=S\\sqrt{2}$$ Solve for \\(S\\) to get $$S=\\frac{D}{\\sqrt{2}}$$If \\(D\\) is increased by 10% that means it is multiplied by 1.1 If we multiply the right side of the above equation we have to multiply the left so our new side is 1.1 times the old side: $$1.1S=\\frac{1.1D}{\\sqrt{2}}$$ The new area is therefore \\(1.1^2S^2\\) Since the old area was equal to \\(x\\), that implies \\(S^2=x\\) the new area is therefore $$1.1^2x=1.21x$$</p>   ', '', '', '', '', '', 'Kevin', ''),
