('Fractions, decimals, and percents', 'Percents', 'percent increase and decrease', 'Percent original', '', '', '', 'No Pic', '', '120', 'After a long rain, a lake increased its volume by 400\\(ft^3\\) to reach a total of 75000\\(ft^3\\). What is the new volume as a percent of the original volume?', '', '\\(100\\frac{1}{2}\\)%', '\\(100\\frac{1}{20}\\)%', '5%', '25%', '50%', '\\(100\\frac{1}{2}\\)%', '222', '<p>The old volume plus 400 is equal to 75000 or $$old+400=75000\\rightarrow old=74600$$ Now that we have the old volume we can find the answer: $$x \\cdot old = 75000\\rightarrow x74600=75000\\rightarrow 75000/74600=x=1.005$$ 1.005 can also be written as \\(100\\frac{1}{2}\\)%</p>    ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent original', '', '', '', 'No Pic', '', '119', 'The average American ate 217 pounds of meat and poultry in 2017. In 2018, that number increased by 2.3%. What was the average amount of meat and poultry consumed in 2018 as a percentage of the amount consumed in 2017?', '', '1.3%', '22.3%', '102.3%', '122.3%', '201.3%', '102.3%', '223', '<p>We don\'t even need to look at the 217lb of meat people are eating. The point is that some number increased 2.3% to reach a new number. The new number is therefore 102.3% of the original number. The 100% is what it starts out at. Every number is 100% of itself. 100% is equal to 1. An increase of 2.3% therefore makes the new number 102.3% of the old number. You can also look at it algebraically: $$old+0.023\\cdot old=new$$ $$ old(1+0.023)=new$$ $$ old\\cdot 1.023=new$$</p> ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent original', '', '', '', 'No Pic', '', '118', 'In 1986, there were 360,000 people in prison or jail in the United states. By 2016, that number had increased to 2.2 million. In 2016, the number of people imprisoned was approximately what percentage of the number imprisoned in 1986?', '', '500%', '600%', '700%', '800%', '900%', '600%', '223', '<p>$$x360000=2200000$$ $$x=\\frac{2200000}{360000}$$ $$x=6.1$$ Simply convert 6.1 to a percent and we have 610%. Round down to our answer, 600% </p>      ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent original', '', '', '', 'No Pic', '', '117', 'In the United States, the amount of water used in hydraulic fracturing or fracking has increased 770%. What is the new amount of water used as a percentage of the original amount?', '', '77%', '677%', '770%', '870%', '970%', '870%', '223', '<p>If the amount stays the same the new amount is 100% of the old amount. A number is always 100% of itself because 100% is equal to 1 and a number multiplied by 1 remains the same. If a number increases by 770% it means it increased 770% past itself. Since it starts at 100%, the new number is 870% of the old number. Algebraically: $$x+7.7x=new$$ $$8.7x=new$$ </p>   ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent change', '', '', '', 'No Pic', '', '116', 'A right triangle is stretched so that its hypotenuse increases from 15in to 20 in. What was the percentage change in the hypotenuse of the triangle', '', '25%', '33.3%', '125%', '133.3%', '114.2%', '33.3%', '223', '<p>Ignore the geometry reference. The point is a number goes from 15 to 20. What is the percentage change. $$15x=20$$ $$x=\\frac{20}{15}=1.333$$ 20 is 1.333 times 15 or 1333% of 15. So 15 increases by 333% to reach 20. Note: $$15+x(15)=20$$ $$15(1+x)=20$$ $$1+x=\\frac{20}{15}$$ $$x=\\frac{20}{15}-1=0.333$$</p> ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent change', '', '', '', 'No Pic', '', '115', 'The Democratic candidate for governor received 10% more votes than the Republican. If the republican received 880 votes, how many votes did the Democrat receive?', '', '88', '792', '968', '1056', '1144', '968', '223', '<p>$$D=R+0.1R$$ $$D=R(1+0.1)$$ $$D=1.1R$$ $$D=1.1(880)$$ $$D=968$$</p>      ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent change', '', '', '', 'No Pic', '', '97', 'Amoy has to pay \\(25\\)% of her income to taxes. She pays <span>&#36;</span>25.00. How much income did she have?', '', '25', '50', '75', '100', '125', '100', '224', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>Amoy has to pay \\(25\\)% of her income to taxes.</p> <p> Let the variable \\(i\\) equal Amoy\'s income and \\(t\\) equal Amoy\'s tax bill. Using these variables, we can translate the first sentence to be stating: $$t=0.25i$$  \"taxes\" or t, \"is\" or =, \"25%\" or 0.25, \"of\" or times, \"income\" or i. </p> <p>The second sentence gives a value for Amoy\'s tax bill or t $$t=25$$ Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(i\\) or Amoy\'s income so we can plug the given value of 25 for \\(t\\) into the first equation to get $$25=0.25i$$ Now we have one equation with one unknown. Solve for \\(i\\) and you have the answer. $$25=0.25i\\rightarrow \\frac{25}{.25}=i\\rightarrow \\boxed{i=100}$$</p>', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'percent change and percent of original', 'Percent change', '', '', '', 'No Pic', '', '121', 'The speed at which airplanes travel in 2018 is 120% of the speed they travelled in 2010. What was the percentage increase between 2010 and 2018 in airplane travel speed?', '', '20%', '80%', '120%', '180%', '220%', '20%', '224', '<p>Let the speed of the slower 2010 planes be called \\(x\\) and the faster 2018 planes be called \\(y\\) we have $$1.2x=y$$ $$x+0.2x=y$$ So the new plane speed is equal to the old plane speed plus 0.2 times the old plane speed or an increase of 20%</p>  ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'Successive percents', '', '', '', '', 'No Pic', '', '143', 'In 2014, Kenneth invests his savings in the stock market. From 2014 to 2015, he loses 75% of his investment. But then from 2015 to 2016 his remaining money increases by 100%. At the start of 2016, how much money does he have as a percentage of his original investment. ', '12671', '25%', '50%', '100%', '125%', '150%', '50%', '225', '<p>He starts with \\(x\\) money invested. He first loses 75% or \\(x=0.75=0.25x\\)Then this remaining \\(0.25x\\) increases by 100% or \\(0.25x+0.25x=0.5x\\) Therefore, at the end he is left with \\(0.5x\\) or half of what he started with, 50%.</p>    ', '', '', '', '', '', 'Kevin', ''),
('Fractions, decimals, and percents', 'Percents', 'Successive percents', '', '', '', '', 'No Pic', '', '144', 'Alonso has 10% less compassion than Brandt. Brand has 60% more compassion than Ronny. Ronny has 50% less compassion than Terrell.  <div id=\"content-wrapper\">\n      <div id=\"content\">\n        <div class=\"textTable\">\n          <strong> Quantity A</strong></p>Alonso\'s compassion\n        </div>\n        <div class=\"textTable\">\n          <strong> Quantity B</strong></p>Terrell\'s compassion\n        </div>\n      </div>\n    </div>', '12581', 'Quantity A is greater.', 'Quantity B is greater.', 'The two quantities are equal.', 'The relationship cannot be determined from the information given.', '', 'Quantity B is greater.', '225', '<p>Simply follow the chain of percents. $$A=B-0.1B \\rightarrow A=0.9B$$ $$B=R+0.6R\\rightarrow B=1.6R$$ $$R=T-0.5T \\rightarrow R=0.5T$$ Now we can collapse all the equations: $$A=0.9(1.6(0.5T))$$ $$A=0.72T$$ Clearly \\(A\\) is less than \\(T\\) Quantity B is greater</p>    ', '', '', '', '', '', 'Kevin', ''),
