('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '114', 'Shiva spends  <span>&#36;</span>10 a day on living expenses. Today, she has half as much money as she had  a week ago (7 days ago). How much money does she have now?', '', '100', '90', '80', '70', '60', '70', '231', '<p>Like many word problems, each sentence of this question can be translated into an algebraic equation. Take the first sentence:</p> <p> \"Shiva spends  <span>&#36;</span>10 a day on living expenses.\" </p> <p>This can be translated to the algebraic equation $$m=s-10d$$ Where \\(m\\) is the amount of money Sheva has today, and \\(s\\) is the amount of money Sheva had \\(d\\) days ago. Since Sheva spends <span>&#36;</span>10  a day, subtract ten times the number of days that have passed from her starting money to reach her present money.</p><p>The second sentence can also be translated into an equation. The second sentence states:</p> <p>Today, she has half as much money as she had  a week ago (7 days ago). </p> <p>We can translate the sentence using the same variables we created for the first sentence. \"Today she has\" implies \\(m=\\). \"half as much money as she had\" implies \\(\\frac{1}{2}s\\). Putting these two pieces together we get $$m=\\frac{1}{2}s$$</p> Finally, the starting money is given as the money Shiva had seven days ago or \\(d=7\\). Therefore, using the first equation, \\(m=s-10d\\) and the second equation \\(m=\\frac{1}{2}s\\) we can plug in \\(d=7\\) which is given and we have two equations with two unknowns: $$m=s-70$$ and $$m=\\frac{1}{2}s$$ Substitute \\(s-70\\) in place of \\(m\\) in the second equation and solve for s: $$s-70=\\frac{1}{2}s$$ Move terms with \\(s\\) to the same side of the equation by subtracting \\(\\frac{1}{2}s\\) from both sides of the equation to get: $$\\frac{1}{2}s-70=0$$ Now we can move non-s terms to the other side of the equals sign. Add 70 to both sides to get: $$\\frac{1}{2}s=70$$ Cancel the s-coefficient by multiplying both sides by the reciprocal of the coefficient: $$\\frac{1}{2}x2=70(2)$$ This simplifies to $$s=140$$ However, we are not done. The question does not ask for \\(s\\) or the amount she had but for \\(m\\) the amount she has now. But we now know \\(s=140\\) to solve for m we can simply substitute 140 in place of \\(s\\) in the second equation to get $$m=\\frac{1}{2}140\\rightarrow \\boxed{m=70}$$', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '101', 'Aaliya spends  <span>&#36;</span>16.00 on the cake and venue for her birthday party. She spent three times as much on the venue than she did on the cake. How much did she spend on the cake?', '12670', '4', '8', '12', '16', '20', '4', '231', '<p>Let \\(c\\) be the amount Aaliya spent on the cake and \\(v\\) be the amount spent on the venue. The question states that the total spent on the party was equal to <span>&#36;</span>16.00. Therefore, \\(c + v=16\\). We are also given that Aaliya spent three times as much on the venue than she did on the cake. Meaning, \\(v=3c\\). Substituting \\(3c\\) in place of \\(v\\) in the first equation we get \\(c+3c=16\\). </p> <p> to solve this equation first combine like terms - \\(4c=16\\) Next, isolate \\(c\\) by dividing both sides of the equation by \\(4\\). Thus, we get \\(c=\\frac{16}{4}\\) or \\(c=4\\). Therefore, the answer is \\(\\boxed{4}\\)</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '103', 'Janique is staying at a resort with an ongoing promotion: The first three nights cost <span>&#36;</span>100 per night and every additional night past 3 is half price. If she is charged <span>&#36;</span>1050 at the end of her stay, how many nights did she stay?', '', '18', '21', '24', '27', '30', '18', '231', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>The first three nights cost <span>&#36;</span>100 per night and every additional night past 3 is half price.</p> <p> Let the variable \\(n\\) equal the number of nights Janique spent at the hotel and \\(t\\) equal total cost of her stay. Using \\(n\\) and assuming the stay was \\(\\geq\\)3 nights, we can translate the cost of the stay to be: $$3(100)+\\frac{1}{2}100(n-3)=t$$  The \\(3(100)\\) is the charge for the first three nights and the \\(\\frac{1}{2}100(n-3)\\) is the charge for the additional nights past 3 that are half of 100 or half off. </p> <p>The second sentence gives her total cost as \\(t=1050\\). Substitute this given value for \\(t\\) into the first equation and you have one equation with one unknown. $$100(3)+\\frac{1}{2}100(n-3)=1050$$ Solve for \\(n\\). $$300+50(n-3)=1050   \\rightarrow 300+50n-150=1050\\rightarrow 150+50n=1050\\rightarrow 50n=900\\rightarrow n=\\frac{900}{50}\\rightarrow \\boxed{n=18}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '98', 'Selena is twice as old as Ashani. If Ashani and Selena\'s ages add up to 54, how old is Selena?', '325', '12', '18', '24', '30', '36', '36', '231', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>Selena is twice as old as Ashani</p> <p> Let the variable \\(s\\) equal selena\'s age and \\(a\\) equal Ashani\'s age. Using these variables, we can translate the first sentence to be stating: $$s=2a$$  \"Selena\" or s, \"is\" or =, \"twice as old as Ashani\" or 2a. </p> <p>The second sentence gives the sum of both their ages. We can easily translate this to $$s+a=54$$ Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(s\\) or Selena\'s age so we first solve one equation for \\(a\\). Solving the second equation for a: $$s+a=54\\rightarrow a=54-s$$ Plug \\(54-s\\) in place of \\(a\\) in the first equation to get: $$s=2(54-s)$$ Solve for s to get the answer: $$s=108-2s\\rightarrow 3s=108\\rightarrow s=\\frac{108}{3}\\rightarrow \\boxed{s=36}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '97', 'Amoy has to pay \\(25\\)% of her income to taxes. She pays <span>&#36;</span>25.00. How much income did she have?', '338', '<span>&#36;</span>25', '<span>&#36;</span>75', '<span>&#36;</span>100', '<span>&#36;</span>125', '<span>&#36;</span>175', '<span>&#36;</span>100', '232', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>Amoy has to pay \\(25\\)% of her income to taxes.</p> <p> Let the variable \\(i\\) equal Amoy\'s income and \\(t\\) equal Amoy\'s tax bill. Using these variables, we can translate the first sentence to be stating: $$t=0.25i$$  \"taxes\" or t, \"is\" or =, \"25%\" or 0.25, \"of\" or times, \"income\" or i. </p> <p>The second sentence gives a value for Amoy\'s tax bill or t $$t=25$$ Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(i\\) or Amoy\'s income so we can plug the given value of 25 for \\(t\\) into the first equation to get $$25=0.25i$$ Now we have one equation with one unknown. Solve for \\(i\\) and you have the answer. $$25=0.25i\\rightarrow \\frac{25}{.25}=i\\rightarrow \\boxed{i=100}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '96', 'A taxi charges a flat starting fee of <span>&#36;</span>\\(3.00\\) and another  <span>&#36;</span>\\(0.50 \\) for each mile driven. If Lloyd takes a trip in the taxi and is charged a total of <span>&#36;</span>\\(8.50\\), how many miles did he travel?', '182', '5.5', '7', '9', '11', '12.5', '11', '233', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>A taxi charges a flat starting fee of <span>&#36;</span>\\(3.00\\) and another  <span>&#36;</span>\\(0.50 \\) for each mile driven.</p> <p> Let the variable \\(c\\) equal the cost of the trip and \\(m\\) equal miles driven. Using these variables, we can translate the first sentence to: $$c=3+0.50m$$  cost or c, is equal to the flat fee plus the mileage fee which is given as 3 plus 050 per mile. </p> <p>The second sentence gives $$c=8.50$$ Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(m\\) or the total mileage of the trip. We can plug the given value of 8.50 for \\(c\\) into the first equation to get $$8.50=3+0.5m$$ Now we have one equation with one unknown. Solve for \\(m\\) and you have the answer. $$8.50=3+0.5m\\rightarrow \\frac{8.50-3}{.5}=m\\rightarrow \\boxed{m=11}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '102', 'A lemonade stand sells drinks for  <span>&#36;</span>2.50 each. Each glass of lemonade costs  <span>&#36;</span>0.25 to make and the stand itself costed a one time charge of  <span>&#36;</span>50.00 to start. How many glasses need to be sold for the total profit to equal the number of glasses sold. ', '', '25', '30', '40', '45', '50', '40', '233', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>A lemonade stand sells drinks for  <span>&#36;</span>2.50 each. </p> <p> Let the variable \\(r\\) equal the revenue brought in by lemonade sales and \\(g\\) equal the number of glasses sold. Using these variables, we can translate the first sentence to: $$r=2.50g$$  Revenue or r, is equal to the 2.50 per glass. </p> <p>The second sentence states:</p> <p>Each glass of lemonade costs  <span>&#36;</span>0.25 to make and the stand itself costed a one time charge of  <span>&#36;</span>50.00 to start.</p> <p>Let \\(c\\) equal the total cost. The sentence can now be translated as $$c=0.25g+50$$ Meaning, the total costs are equal to the cost per glass of 0.25 per drink and the one time charge of  <span>&#36;</span>50.00</p> Finally, the last sentence gives profit or \\(p\\) to be equal to the number of glasses sold, which we have already defined as \\(g\\). Therefore we have a third equation $$p=g$$. To review we have three equations: $$r=2.50g$$ $$c=0.25g+50$$ $$p=g$$ The question asks that we find \\(g\\) or the number of glasses sold. To use the above equations to find \\(g\\) you have to know one more important fact: profit is equal to the revenue minus the cost or $$p=r-c$$ This is a logical equation the GRE expects you to know because the total money brought in minus the amount spent on the business is, of course, the amount left over for the stakeholders, in other words, the definition of profit. Using \\(p=r-c\\) we can combined the above equations to  the third equation is equal to the first minus the last or $$g=2.50g-\\left(0.25g+50\\right)$$ Now we have one equation with one unknown. We can solve for \\(g\\) and we have our answer. $$g=2.50g-(0.25g+50)\\rightarrow g=2.50g-0.25g-50\\rightarrow g=2.25g-50 \\rightarrow -1.25g=-50 \\rightarrow g=\\frac{-50}{-1.25} \\rightarrow \\boxed{g=40}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '106', 'A taxi charges<span>&#36;</span>3.00 for the first mile and <span>&#36;</span>0.50 for each additional mile. If Lloyd\'s son takes a trip in the taxi and is charged a total of <span>&#36;</span>8.50, how many miles did he travel?', '', '6.5', '8', '10', '12', '13.5', '12', '233', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>A taxi charges<span>&#36;</span>3.00 for the first mile and <span>&#36;</span>0.50 for each additional mile.</p> <p> Let the variable \\(m\\) equal the number of miles Lloyd\'s son travels  and let \\(t\\) equal the total cost of his trip. Using \\(m\\) and assuming the trip was \\(\\geq\\)1 mile, we can translate the cost of the trip to be: $$3(1)+0.5(m-1)=t$$  The \\(3(1)\\) is the charge for the first mile and the \\(0.5(m-1)\\) is the charge for the additional miles past 1 that are an additional  <span>&#36;</span>0.50 per mile. </p> <p>The second sentence gives the total cost of the trip as \\(t=8.50\\). Substitute this given value for \\(t\\) into the first equation and you have one equation with one unknown. $$(3)+0.5(m-1)=8.50$$ Solve for \\(m\\). $$3+0.50(m-1)=8.50\\rightarrow 3+0.5m-0.5=8.50\\rightarrow 2.5+0.5m=8.50\\rightarrow 0.5mn=6\\rightarrow m=\\frac{6}{0.5}\\rightarrow \\boxed{m=12} $$ </p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '94', 'The sum of three consecutive integers is \\(282\\). What is the first number plus the last number in the sequence', '14', '93', '185', '188', '196', '279', '188', '234', '<p>When solving for sequences with an unknown starting point we can write the first as an unknown variable, call it \\(x\\) and then the remaining terms in the sequence can be written in terms of the first term. In this case, the question states that the sequence is composed of three consecutive integers. Since they are consecutive integers, the second number is the first number plus one and similarly, the third number is equal to the second number plus one. Therefore, the three numbers in terms of the first number are $$x,\\;x+1\\;x+2$$We are given that the sum of the three numbers equals 282. Translating this to algebra we get: $$x+(x+1)+(x+2)=282$$ Simplify and solve for \\(x\\) $$3x+3=282\\rightarrow 3x=279\\rightarrow x=93$$ We found \\(x\\) but remember \\(x\\) is not the answer, \\(x\\) is the first number of the series of three consecutive numbers. The question asks for the sum of the first and third numbers. (In general lookout for questions that require you to solve a variable but then want a function of that variable, in this case \\(x+x+2\\) for the answer) The first number is \\(x\\) and the third number is \\(x+2\\). Therefore the answer is: $$93+95=\\boxed{188}$$</p> ', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', 'Inequality', 'Optimization', '', '', 'No Pic', '', '104', 'If the 400 richest people in the world each have at least <span>&#36;</span \\( > \\) 1b , what is the smallest possible net worth of the 400 richest people combined?', '', '<span>&#36;</span>100B', '<span>&#36;</span>200B', '<span>&#36;</span>250B', '<span>&#36;</span>300B', '<span>&#36;</span>400B', '<span>&#36;</span>400B', '234', '<p> Each of the 400 richest people have at least <span>&#36;</span> 1B $$Rich_x \\geq 1B$$ Therefore, the sum of all 400 richest people will be $$Rich_1+Rich_2...+Rich_{400} \\geq 400B$$ The question asks us for the lowest possible sum. Since the sum is greater than or equal to <span>&#36;</span> 400B the lowest possible sum is <span>&#36;</span> 400B </p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '99', 'Selena is twice as old as Ashani. If Ashani and Selena\'s ages add up to 9, how old is Selena?', '', '3', '4', '6', '8', '10', '6', '235', '<p> Begin by translating the information into equations. The first sentence states:</p> <p>Selena is twice as old as Ashani</p> <p> Let the variable \\(s\\) equal selena\'s age and \\(a\\) equal Ashani\'s age. Using these variables, we can translate the first sentence to be stating: $$s=2a$$  \"Selena\" or s, \"is\" or =, \"twice as old as Ashani\" or 2a. </p> <p>The second sentence gives the sum of both their ages. We can easily translate this to $$s+a=9$$ Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(s\\) or Selena\'s age so we first solve one equation for \\(a\\). Solving the second equation for a: $$s+a=9\\rightarrow a=9-s$$ Plug \\(9-s\\) in place of \\(a\\) in the first equation to get: $$s=2(9-s)$$ Solve for s to get the answer: $$s=18-2s\\rightarrow 3s=18\\rightarrow s=\\frac{18}{3}\\rightarrow \\boxed{s=6}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Algebraic translations', '', '', '', '', 'No Pic', '', '113', ' <span>&#36;</span>32 is spent on a new bridge. The amount spent on steel was   <span>&#36;</span>10 less than the amount spent on everything else combined. How much was spent on steel?', '', '11', '21', '12', '22', '8', '11', '235', '<p> Begin by translating the information into equations. The first sentence states:</p> <p><span>&#36;</span>32 is spent on a new bridge. </p> <p> Let the variable \\(s\\) equal the amount spent on steel and \\(o\\) equal the amount spent on other things. Using these variables, we can translate the first sentence to be stating: $$s+o=32$$  The amount spent on steel and the amount spent on everything else together equal the total amount spent on the bridge which is given as 32. The second sentence states: </p>  <p>The amount spent on steel was   <span>&#36;</span>10 less than the amount spent on everything else combined.  </p><p> We can easily translate this to algebra using our defined variables, \\(s\\) for steel and \\(o\\) for everything else. $$s=o-10$$ The amount spent on steel is or = the amount spent on everything else minus 10 or ten less than the amount spent on everything else. Now, we have two equations with two unknowns and we can solve using substitution.  The question asks for \\(s\\) or the amount spent on steel so we first solve one equation for \\(o\\). Solving the first equation for o: $$s+o=32\\rightarrow o=32-s$$ Plug \\(32-s\\) in place of \\(o\\) in the second equation to get: $$s=32-s-10$$ Solve for s to get the answer: $$s=22-s\\rightarrow 2s=22\\rightarrow s=\\frac{22}{2}\\rightarrow \\boxed{s=11}$$</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
('Word problems', 'Algebraic translations', 'Hidden constraints', 'Whole number', '', '', '', 'No Pic', '', '105', 'Mika has \\(\\frac{1}{4}\\) more houses than Tajo. Which of the following could be the total number of houses between the two of them?', '', '9', '19', '24', '30', '37', '9', '236', '<p>If Tajo has \\(x\\) houses, and Mika has \\(\\frac{1}{4}\\) more houses than Tajo, then Mika has \\(x+\\frac{1}{4}x\\). This simplifies to Mika having \\(\\frac{5}{4}x\\) houses. Combined they both have: $$x+\\frac{5}{4}x=\\frac{9}{4}x$$ So the total number of houses is \\(\\frac{9}{4}x\\) where \\(x\\) is some unknown number. However, there is an implied piece of information here: Tajo or Mika cannot have a half of a house. So \\(x\\) must be an integer. Since Mika has \\(\\frac{1}{4}\\) more houses than Tajo, \\(x\\) must also be divisible by 4. Therefore, \\(\\frac{x}{4}\\) is an integer too. Recall the total number of houses was found to be \\(\\frac{9}{4}x\\) since \\(\\frac{x}{4}\\) is an integer we can rewrite that as: $$total=9\\times integer$$ So whatever that integer is, it is a multiple of 9. Look for the answer choice that is divisible by 9 and that is the answer</p>', 'GRE', '', '', 'Friday Material', '', '', ''),
