('Word problems', 'Conversions', '', '', '', '', '', 'No Pic', '', '110', 'Zain is traveling at a rate of 1 foot per second (1ft/sec). How many feet per minute (ft/min) is Zain traveling?', '797', '\\(1ft/min\\)', '\\(\\frac{1}{30}ft/min\\)', '\\(\\frac{1}{60}ft\\min\\)', '\\(\\frac{1}{120}ft\\min\\)', '\\(\\frac{1}{1200}ft\\min\\)', '\\(\\frac{1}{60}ft\\min\\)', '237', '1', '', '', '', '', '', '', ''),
('Word problems', 'Conversions', '', '', '', '', '', 'No Pic', '', '111', 'Imran is traveling at a rate of 1 mile per hour (1mi/hr). How many feet per minute (ft/hr) is Imran traveling? (1mile = 5280ft)', '', '\\(5280ft/hr\\)', '\\(\\frac{1}{5280}ft/hr\\)', '\\(\\frac{1}{60}ft\\min\\)', '\\(\\frac{1}{120}ft\\min\\)', '\\(\\frac{1}{1200}ft\\min\\)', '\\(\\frac{1}{60}ft\\min\\)', '237', '1', '', '', '', '', '', '', ''),
('Word problems', 'Conversions', '', '', '', '', '', 'No Pic', '', '112', 'If Afan pours water into a pool at a rate of 3 cubic feet per second, at what rate is water filling the pool in cubic inches per minute? (There are \\(12^3\\) cubic inches per cubic foot.)', '', '\\(316800 in^3/min\\)', '\\(2160 in^3/min\\)', '\\(8640 in^3/min\\)', '\\(103680 in^3/min\\)', '\\(311040 in^3/min\\)', '\\(311040 in^3/min\\)', '237', '<p>First, notice that this is a conversion question. For most conversion questions, the question give some rate and asks for an answer in different units. In this case, it gives us cubic feet per second but it asks for an answer in cubic inches per minute. There are two units that change when go from cubic feet per second to inches per minute. One, cubic feet must be converted to cubic inches. Two, seconds must be converted to minutes. To solve, take one conversion at a time. First, we can convert cubic feet to cubic inches. The question tell us that there are \\(12^3\\) cubic inches in a cubic foot. This means there are \\(1728in^3/ft\\). Now lets multiply the rate by our conversion rate. Remember to place the unit that you want to cancel, in this case feet, on opposite sides of the fraction line: $$\\frac{3ft^3}{1sec}\\frac{1728in^3}{1ft^3}$$ The feet units cancel because the left unit is in the numerator and the right one is in the denominator. We are left with: $$\\frac{3\\times1728 in^3}{1sec}=\\frac{5184in^3}{1sec}$$ We are halfway through we changed feet to inches. Now we only have to change seconds to minutes. Since seconds is on the denominator of Afan\'s rate, we want to put seconds in the numerator of our conversion rate. We have $$conversionRate=\\frac{60sec}{1min}$$ Now, we multiply our rate by the conversion rate: $$\\frac{5184in^3}{1sec}\\times \\frac{60sec}{1min}=\\frac{5184 \\times 60in^3}{1min}=\\boxed{311040in^3}{sec}$$ In summary, we did very logical operations. We multiplied the numerator by 60 to go from the water poured per second to water poured per minute and we multiplied the numerator again, by 5184, to go from cubic feet of water to cubic inches of water.</p>', '', '', '', 'Friday Material', '', '', ''),
