('Word problems', 'Statistics', 'Averages', 'Averages', '', '', '', 'No Pic', '', '147', 'Chaim can jump 30in, Fletcher can jump 24in and Jabari can jump at most as high as Chaim and at least as high as Fletcher. What is the <strong>highest</strong> possible average of all three jump-heights', '', '22', '24', '26', '28', '30', '28', '247', '<p>Intuitively, to allow the average jump-height to reach its max we need each individual\'s jump height to be at its max. Chaim\'s and Fletcher\'s jump-heights are set at 30in and 24in respectively, we can\'t choose those. However, Jabari\'s jump-height can be anywhere from as low as Fletcher\'s to as high as Chaim\'s or from 24in to 30in. Therefore, to make the average height the highest, set Jabari\'s height to the high end of his range or 30in. </p> $$Average={Jabari+Chaim+Fletcher}{3}=\\frac{30+30+24}{3}=\\boxed{28}$$', '', '', '', '', '', '', 'Averages'),
('Word problems', 'Statistics', 'Averages', 'Averages', '', '', '', 'No Pic', '', '148', 'Chaim can jump 30in, Fletcher can jump 24in and Jabari can jump at most as high as Chaim and at least as high as Fletcher. What is the <strong>lowest</strong> possible average of all three jump-heights', '', '22', '24', '26', '28', '30', '26', '247', '<p>Intuitively, to allow the average jump-height to reach its minimum we need each individual\'s jump height to be at its minimum. Chaim\'s and Fletcher\'s jump-heights are set at 30in and 24in respectively, we can\'t choose those. However, Jabari\'s jump-height can be anywhere from as low as Fletcher\'s to as high as Chaim\'s or from 24in to 30in. Therefore, to make the average height the lowest, set Jabari\'s height to the low end of his range or 24in. </p> $$Average={Jabari+Chaim+Fletcher}{3}=\\frac{24+30+24}{3}=\\boxed{26}$$', '', '', '', '', '', '', 'Averages'),
('Word problems', 'Statistics', 'Averages', 'Averages with unknown variables', '', '', '', 'No Pic', '', '', '', '', '1', '2', '3', '4', '5', '5', '248', '1', '', '', '', '', '', '', ''),
