('Word problems', 'Statistics', 'Averages', 'Weighted averages', '', '', '', 'No Pic', '', '145', 'In a fifteen person class, ten people scored a 50 on the exam and five people scored a 80. What was the average score on the exam?', '', '50', '55', '60', '\\(66 \\frac{2}{3}\\)', '75', '60', '250', '<p>The sum of the ten people who scored a 50 is \\(50\\times 10=500\\) The sum of the five people who scored a 80 is equal to \\(80 \\times 5=400\\) Therefore, the sum of all the elements or scores is equal to \\(400+500=900\\) The average is the sum of scores divided by the number of scores or \\(\\frac{900}{15}=60\\)</p>', '', '', '', '', '', '', 'Averages'),
('Word problems', 'Statistics', 'Averages', 'Weighted averages', '', '', '', 'No Pic', '', '146', 'If the average temperature in June and September is 65 degrees while the average temperature in November is 50 degrees, what is the average temperature in June, September and November? (All three months have 30 days) ', '', '50', '55', '60', '65', '70', '60', '250', '<p>The average temperature in June and September is  65 degrees. This implies that the sum of the average temperature in June and the average temperature in September, divided by 2, equals 65. Because: $$average=\\frac{June + September}{2}\\rightarrow 65=\\frac{June+September}{2}\\rightarrow 2\\times 65=June + September\\rightarrow 130=June + September$$ Since the sum of June and September is 2 times their average or 130 and the average temp in November is 50 degrees, the sum of all three months is \\(50+130=180\\) The average of all three months is therefore: $$\\frac{180}{3}=60$$</p>', '', '', '', '', '', '', 'Averages'),
('Word problems', 'Statistics', 'Median', 'Median', '', '', '', 'No Pic', '', '150', '    A set \\(A\\) is the set of numbers: \\(A=\\{3,\\:2,\\:6,\\:1,\\:9\\:\\}\\)<div id=\"content-wrapper\">\n      <div id=\"content\">\n        <div class=\"textTable\">\n          <strong> Quantity A</strong></p>Median of set A\n        </div>\n        <div class=\"textTable\">\n          <strong> Quantity B</strong></p>Mean of set A\n        </div>\n      </div>\n    </div>', '', 'Quantity A is greater.', 'Quantity B is greater.', 'The two quantities are equal.', 'The relationship cannot be determined from the information given.', '', 'Quantity B is greater.', '251', '<p>The median of a set is the middle number. If there is an odd number of items in the set, sort them from least to greatest and the median equals the middle number or, in this set of 5 numbers the median is the third number, and Quantity A is 3. (If there are an even number of items in the set, the median is equal to the average of the middle two numbers.) Quantity B is the mean of set A or the average which is the sum of set A divided by the number of elements\\(\\frac{1+2+3+6+9}{5}=mean=\\frac{21}{5}=4.2\\) So quantity B is greater than 3 and that is the answer.</p>', '', '', '', '', '', '', 'Averages'),
('Word problems', 'Statistics', 'Median', 'Median with unknown variables', '', '', '', 'No Pic', '', '', '', '', '1', '2', '3', '4', '5', '5', '252', '1', '', '', '', '', '', '', '');
