('Word problems', 'Statistics', 'Range', '', '', '', '', 'No Pic', '', '149', ' A set \\(A\\) is the set of positive numbers: \\(A=\\{3,\\:2,\\:x,\\:1,\\:9\\:\\}\\). If the range of the set is 10, what is x', '', '8', '9', '10', '11', '12', '11', '253', 'The question gives us that all the numbers in  set A are positive, meaning \\(x > 0\\). It also gives the range as 10. This implies, by definition that: \\(largest-smallest=10\\). If \\(x\\) were between 1 and 9 than the range would be \\(9-1=8\\) which is not large enough. Therefore, \\(x\\) must be the minimum and less than 1 or the maximum and greater than 9. \\(x\\)  can\'t be the new minimum because then \\(9-x=10\\) so \\(x=-1\\) and \\(x\\) would be less than 0 but our numbers were given as \"positive\" in the question text. Therefore, the range is \\(x-1=10\\). Add 1 to both sides to get \\(x=11\\) or choice d.', '', '', '', '', '', '', 'Ranges'),
('Word problems', 'Statistics', 'Range', '', '', '', '', 'No Pic', '', '151', ' A set \\(A\\) is the set of positive numbers: \\(A=\\{0,\\:x,\\:x^2,\\:1\\:\\}\\). If the range of the set is 4, what is the mean of the set', '', '2', '4', '6', '8', '10', '2', '253', 'The question gives us that all the numbers in  set A are positive, meaning \\(x > 0\\). It also gives the range as 10. This implies, by definition that: \\(largest-smallest=10\\). If \\(x\\) were between 1 and 9 than the range would be \\(9-1=8\\) which is not large enough. Therefore, \\(x\\) must be the minimum and less than 0 or \\(x^2\\) must be the maximum and greater than 1. \\(x\\)  can\'t be the new minimum because \\(x > 0\\). Therefore, the range is \\(x^2-0=4\\rightarrow x=2\\). Our set is therefore \\(A=\\{0,\\:2,\\:2^2,\\:1\\:\\}\\) The mean is therefore \\(\\frac{1+1+2+4}{4}=2\\) Answer choice a', '', '', '', '', '', '', 'Ranges'),
