('Word problems', 'Statistics', 'Variance', '', '', '', '', 'No Pic', '', '158', '\\(A=\\{3,\\:2,\\:6,\\:1,\\:9\\:\\}\\)  \\(B=\\{6,\\:4,\\:12,\\:2,\\:\\:18\\}\\)= <div id=\"content-wrapper\">\n      <div id=\"content\">\n        <div class=\"textTable\">\n          <strong> Quantity A</strong></p>Standard deviation of A\n        </div>\n        <div class=\"textTable\">\n          <strong> Quantity B</strong></p>Standard deviation of B\n        </div>\n      </div>\n    </div>', '', 'Quantity A is greater.', 'Quantity B is greater.', 'The two quantities are equal.', 'The relationship cannot be determined from the information given.', '', 'Quantity B is greater.', '256', '1', '', '', '', '', '', '', ''),
