('Word problems', 'Probability', 'More than one event', 'Or', 'dependent', 'Mutually exclusive', '', 'No Pic', '', '44', 'One card is selected from a standard deck of cards. What is the probability it is red or a picture card? (In a standard deck of cards there are three types of face card - Jack, Queen and King. There are four of each type of card so there are twelve face cards. Two cards from each type of card are red and two are black. There are 13 different types of cards (1-9, J, Q, and K). Therefore, there are 26 red cards, 26 black cards, and 52 cards in total.)', '', '\\(\\frac{19}{36}\\)', '\\(\\frac{1}{2}\\)', '\\(\\frac{9}{13}\\)', '\\(\\frac{19}{26}\\)', '\\(\\frac{9}{13}\\)', '\\(\\frac{9}{13}\\)', '288', '1', '', '', '', '', '', '', ''),
