('Word problems', 'Probability', 'Complement', '', '', '', '', 'No Pic', '', '46', 'An airplane has four engines and it  needs at least one of its engines to sustain flight. If each engine has an independent probability of failure of 25%, what is the probability the airplane sustains flight?', '5566', '0.0039', '0.9961', '0.0156', '0.75', '0.7759', '0.9961', '292', 'The airplane only needs at least one engine to remain flying. Therefore, the airplane will only crash if all its engines fail. The probability of one engine failing is given as 025. Therefore, since independence is given, the probability of all four engines failing is \\(0.25^4\\). Therefore, the probability of a crash is \\(0.25^4=0.0039\\). However, we are not done. The question asks for the probability the airplane will stay flying or not crash. If the probability of a crash is 0.0039, and the probability of all possible events must sum to 1, the probability of \"not a crash\" is \\(1-0.0039=0.9961\\) or b. ', '', '', '', '', '', '', ''),
