('Form', 'Answer', 'Variables in answer', '', '', '', '', 'No Pic', '', '107', 'Lebron James is shooting free-throws at a \\(x\\)% success rate. If he gets fouled on a missed 3-pointer and shoots three free-throws, what are the chances he makes at least one free throw?', '', '\\(x\\)', '\\(x^3\\)', '\\(3(x^3)\\)', '\\( (1-x)^3\\)', '\\(1-(1-x)^3\\)', '\\(1-(1-x)^3\\)', '298', '<p>Think about what \"at least 1 means\". He takes three shots. So at least can mean hitting 1, hitting 2, or hitting on all 3. To find the probability of each of those three scenarios and adding them up is tedious and would take awhile. Instead, use a trick: when a probability question has the words \"at least\" in it, you can usually calculate the complement, meaning the probability of not making at least 1. Then, simply subtract this probability of not making at least 1 free throw from 1 get the answer. This works since the sum of the probabilities of every possible event must add up to 1. Therefore, 1-the probability of not making at least 1 is equal to the probability of making at least 1. </p> <p>The probability of not making at least 1 is simple because it only involves one event. The only way to not make at least one is to miss all three. Lebron has x% chance of making a free throw so the probability of Lebron missing a free throw is 1-x%. Therefore, the probability of him missing three in a row, is \\( (1-x)\\cdot (1-x) \\cdot (1-x)\\) or \\((1-x)^3\\). Therefore the answer is the complement of him missing all three or \\(1-(1-x%)^3\\)</p>', '', '', '', '', '', 'Kevin', ''),
('Form', 'Answer', 'Variables in answer', '', '', '', '', 'No Pic', '', '109', 'Lebron James makes \\(x\\) out of every \\(y\\) free-throws. If he gets fouled on a missed 3-pointer and shoots three free-throws, what are the chances he makes at least one free throw?', '', '\\(\\frac{x}{y}\\)', '\\(\\frac{x}{y}^3\\)', '\\(300\\frac{x}{y}^3\\)', '\\( (1-\\frac{x}{y})^3\\)', '\\((1-(1-\\frac{x}{y})^3)\\)', '\\((1-(1-\\frac{x}{y})^3)\\)', '298', '<p>Think about what \"at least 1 means\". He takes three shots. So at least can mean hitting 1, hitting 2, or hitting on all 3. To find the probability of each of those three scenarios and adding them up is tedious and would take awhile. Instead, use a trick: when a probability question has the words \"at least\" in it, you can usually calculate the complement, meaning the probability of not making at least 1. Then, simply subtract this probability of not making at least 1 free throw from 1 get the answer. This works since the sum of the probabilities of every possible event must add up to 1. Therefore, 1-the probability of not making at least 1 is equal to the probability of making at least 1. </p> <p>The probability of not making at least 1 is simple because it only involves one event. The only way to not make at least one is to miss all three. Lebron has \\(\\frac{x}{y}\\) chance of making a free throw so the probability of Lebron missing a free throw is \\(1-\\frac{x}{y}\\). Therefore, the probability of him missing three in a row, is \\( (1-\\frac{x}{y})\\cdot (1-\\frac{x}{y}) \\cdot (1-\\frac{x}{y})\\) or \\((1-\\frac{x}{y})^3\\). Therefore the answer is the complement of him missing all three or \\(1-(1-\\frac{x}{y})^3\\)</p>', '', '', '', '', '', 'Kevin', ''),
